import React, { Component } from 'react';

class Header extends Component {
    render() {
        const { title, subtitle } = this.props;
        return (
            <div>
                <h1 className='title'>{title}</h1>
                <h2 className='subtitle'>{subtitle}</h2>
            </div>
        );
    }
}

export default Header;
